import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import axios from "axios";
//import "./docRegister.css";

const DocRegister = () => {
  const navigate = useNavigate();
  const [doctor, setDoctor] = useState({
    name: "",
    email: "",
    password: "",
    specialization: "",
    degree: "",
    timeslots: {
      monday: { start: "", end: "" },
      tuesday: { start: "", end: "" },
      wednesday: { start: "", end: "" },
      thursday: { start: "", end: "" },
      friday: { start: "", end: "" },
      saturday: { start: "", end: "" },
      sunday: { start: "", end: "" },
    },
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
  
    // If the changed field is part of the timeslots object, handle it separately
    if (name.startsWith("timeslots")) {
      const [_, day, timeType] = name.split(".");
      setDoctor((prevDoctor) => ({
        ...prevDoctor,
        timeslots: {
          ...prevDoctor.timeslots,
          [day]: {
            ...prevDoctor.timeslots[day],
            [timeType]: value,
          },
        },
      }));
    } else {
      setDoctor((prevDoctor) => ({
        ...prevDoctor,
        [name]: value,
      }));
    }
  };
  
  
  const handleTimeslotChange = (e, day, timeType) => {
    const { value } = e.target;
    setDoctor({
      ...doctor,
      timeslots: {
        ...doctor.timeslots,
        [day]: {
          ...doctor.timeslots[day],
          [timeType]: value,
        },
      },
    });
  };

  const registerDoctor = async () => {
    const { name, email, password, specialization, degree, timeslots } = doctor;
  
    // Log the doctor state before making the registration request
    console.log("Doctor state before registration:", doctor);
  
    // Check if any required field is empty
    if (!name || !email || !password || !specialization || !degree || !validateTimeslots(timeslots)) {
      alert("Please fill in all required fields");
      return;
    }
  
    try {
      // Make the Axios POST request
      const response = await axios.post("http://localhost:9002/register/doctor", {
        name,
        email,
        password,
        degree,
        timeslots,
        specialization,
      });
  
      // Handle successful registration
      alert(response.data.message);
      navigate("/login");
    } catch (error) {
      // Handle registration error
      console.error("Doctor registration error:", error);
      alert("An error occurred during registration");
    }
  };
  
  

  const validateTimeslots = (timeslots) => {
    for (const day in timeslots) {
      if (!timeslots[day].start || !timeslots[day].end) {
        return false;
      }
    }
    return true;
  };

  return (
    <div className="doc-register">
      <h1>Doctor Registration</h1>
      <input
        type="text"
        name="name"
        value={doctor.name}
        placeholder="Your Name"
        onChange={handleChange}
      />
      <input
        type="text"
        name="email"
        value={doctor.email}
        placeholder="Your Email"
        onChange={handleChange}
      />
      <input
        type="password"
        name="password"
        value={doctor.password}
        placeholder="Your Password"
        onChange={handleChange}
      />
      <input
        type="text"
        name="specialization"
        value={doctor.specialization}
        placeholder="Your Specialization"
        onChange={handleChange}
      />
      <input
        type="text"
        name="degree"
        value={doctor.degree}
        placeholder="Your Degree"
        onChange={handleChange}
      />
      <div>
        <label>Monday:</label>
        <select value={doctor.timeslots.monday.start} onChange={(e) => handleTimeslotChange(e, "monday", "start")}>
          <option value="">Select Start Time</option>
          <option value="9:00 AM">9:00 AM</option>
          <option value="10:00 AM">10:00 AM</option>
          {/* Add more options as needed */}
        </select>
        <select value={doctor.timeslots.monday.end} onChange={(e) => handleTimeslotChange(e, "monday", "end")}>
          <option value="">Select End Time</option>
          <option value="12:00 PM">12:00 PM</option>
          <option value="1:00 PM">1:00 PM</option>
          {/* Add more options as needed */}
        </select>
      </div>
      {/* Repeat similar input structure for other days */}
      <div className="button" onClick={registerDoctor}>
        Register as Doctor
      </div>
    </div>
  );
};

export default DocRegister;
